import { useState } from "react";
import Biometric from "../components/Biometric";
import FacultyTimetable from "../components/FacultyTimetable";
import StudentAttendance from "../components/StudentAttendance";
import "../styles/app.css";

export default function FacultyDashboard() {
  const [menu, setMenu] = useState("biometric");

  return (
    <div className="dashboard">
      <h1>Faculty Dashboard</h1>

      <div className="menu-bar">
        <button onClick={() => setMenu("biometric")}>Biometric</button>
        <button onClick={() => setMenu("timetable")}>My Timetable</button>
        <button onClick={() => setMenu("attendance")}>Student Attendance</button>
      </div>

      <div className="content">
        {menu === "biometric" && <Biometric />}
        {menu === "timetable" && <FacultyTimetable />}
        {menu === "attendance" && <StudentAttendance />}
      </div>
    </div>
  );
}
